import data from "./data";


function App() {
  return (
    <div>
      <header>
        <a href="/">OShop</a>
      </header>
      <main>
        <h1>Featured Products</h1>
        {
          <div>
            data.products.map(product => (
            <div key={product.slug}>
              <img src={product.image} alt={product.name}/>
              <p>
                {product.name}
              </p>
              <p>
                {product.price}
              </p>
            </div>))
          </div>
        }
      </main>
    </div>
  );
}

export default App;
